import { TodoLists } from "./Pages/TodoLists";
import { GlobalStyle } from "./Style/GlobalStyle";
import { Route, Routes } from "react-router-dom";
import { AddPage } from "./Pages/AddPage";

function App() {
  return (
    <>
      <GlobalStyle />
      <div className="App">
        <Routes>
          <Route exact path="/">
            <TodoLists />
          </Route>
          <Route path="/add">
            <AddPage />
          </Route>
        </Routes>
      </div>
    </>
  );
}

export default App;
